DROP TABLE IF EXISTS `carddetail`;
CREATE TABLE `carddetail` (
  `userid` int(11) NOT NULL,
  `cardid` int(11) NOT NULL,
  `quantity` int(11) NOT NULL,
  PRIMARY KEY (`userid`,`cardid`),
  KEY `userid` (`userid`),
  KEY `cardid` (`cardid`),
  CONSTRAINT `carddetail_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `carddetail_ibfk_2` FOREIGN KEY (`cardid`) REFERENCES `card` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

