DROP TABLE IF EXISTS `deck`;
CREATE TABLE `deck` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(25) NOT NULL,
  `description` varchar(100) NOT NULL,
  `image` mediumblob NOT NULL,
  PRIMARY KEY (`id`)
