DROP TABLE IF EXISTS `deckdetail`;
CREATE TABLE `deckdetail` (
  `deckid` int(11) NOT NULL,
  `cardid` int(11) NOT NULL,
  `quantity` int(11) NOT NULL,
  PRIMARY KEY (`deckid`,`cardid`),
  KEY `deckid` (`deckid`),
  KEY `cardid` (`cardid`),
  CONSTRAINT `deckdetail_ibfk_1` FOREIGN KEY (`deckid`) REFERENCES `deck` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `deckdetail_ibfk_2` FOREIGN KEY (`cardid`) REFERENCES `card` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

