(9,	2,	1);

DROP TABLE IF EXISTS `deckuser`;
CREATE TABLE `deckuser` (
  `deckid` int(11) NOT NULL,
  `userid` int(11) NOT NULL,
  PRIMARY KEY (`deckid`,`userid`),
  KEY `userid` (`userid`),
  KEY `deckid` (`deckid`),
  CONSTRAINT `deckuser_ibfk_1` FOREIGN KEY (`userid`) REFERENCES `user` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `deckuser_ibfk_2` FOREIGN KEY (`deckid`) REFERENCES `deck` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

