DROP TABLE IF EXISTS `packdetail`;
CREATE TABLE `packdetail` (
  `packid` int(11) NOT NULL,
  `cardid` int(11) NOT NULL,
  `quantity` int(11) NOT NULL,
  PRIMARY KEY (`packid`,`cardid`),
  KEY `packid` (`packid`),
  KEY `cardid` (`cardid`),
  CONSTRAINT `packdetail_ibfk_1` FOREIGN KEY (`packid`) REFERENCES `pack` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
